import '../main.css';

function AuthorPile({props}) {
  var picPath = require('./img/people/kjfeng.jpeg')
  return (
    <div className="authorpile">
      {props.authors.map((author, index) => {
        <div>
          <div className="circle-pic" style={{backgroundImage: `url(${author[1]})`}}></div>
          <h5 className="author-name">{author[0]}</h5>
        </div>

      })}


    </div>
  );
}

